angular.module('ae.datafree.tpls', []).run(['$templateCache', function($templateCache) {$templateCache.put('datafree-pager.html','<ul class="datafree-pager">\n    <li ng-if="$pager.showFirst" ng-click="$pager.first()" ng-class="{\'disabled\': $pager.currentPage == 1}">\n        <a href="javascript:void(0);" ng-click="$pager.first()" ng-disabled="$pager.currentPage == 1"\n           ng-class="{\'disabled\': $pager.currentPage == 1}">\n            {{ $pager.firstLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.showPrev" ng-click="$pager.prev()" ng-class="{\'disabled\': $pager.currentPage == 1}">\n        <a href="javascript:void(0);"  ng-click="$pager.prev()" ng-disabled="$pager.currentPage == 1"\n           ng-class="{\'disabled\': $pager.currentPage == 1}">\n            {{ $pager.prevLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.currentPage > $pager.numberLimit"\n        ng-click="$pager.page(Math.max(1, $pager.currentPage - $pager.numberLimit))">\n        <a href="javascript:void(0);" ng-click="$pager.page(Math.max(1, $pager.currentPage - $pager.numberLimit))">\n            &hellip;\n        </a>\n    </li>\n    <li ng-repeat="number in $pager.numbers" ng-click="$pager.page(number)"\n        ng-class="{\'active\': $pager.currentPage == number}">\n        <a href="javascript:void(0);" ng-click="$pager.page(number)" ng-class="{\'active\': $pager.currentPage == number}">\n            {{ number }}\n        </a>\n    </li>\n    <li ng-if="$pager.currentPage <= $pager.maxPages - $pager.numberLimit"\n        ng-click="$pager.page(Math.min($pager.maxPages, $pager.currentPage + $pager.numberLimit))">\n        <a href="javascript:void(0);"\n           ng-click="$pager.page(Math.min($pager.maxPages, $pager.currentPage + $pager.numberLimit))">\n            &hellip;\n        </a>\n    </li>\n    <li ng-if="$pager.showNext" ng-click="$pager.next()" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n        <a href="javascript:void(0);"\n           ng-click="$pager.next()" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n            {{ $pager.nextLabel }}\n        </a>\n    </li>\n    <li ng-if="$pager.showLast" ng-click="$pager.last()" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n        <a href="javascript:void(0);"\n           ng-click="$pager.last()" ng-class="{\'disabled\': $pager.currentPage == $pager.maxPages}">\n            {{ $pager.lastLabel }}\n        </a>\n    </li>\n</ul>');}]);